import React from 'react';
import './Card.css';
export default function Card(){
    return(
        <>
        <div className="s-card">
           <div className="c-img">
               <img src="" alt="" />
           </div>
           <div className="c-title">
               HTML|CSS
           </div>
           <div className="c-des"></div>
        </div>
        </>
    )
}
